create table pcr_credit_card_summary
(
    id                      varchar(64)    not null comment '主键ID',
    order_id                varchar(64)    null comment '订单流水号',
    serial_id               varchar(64)    null comment '数据流水号',
    etl_id                  varchar(64)    null comment '清洗流水号',
    report_id               varchar(32)    null comment '报告编号',
    org_num                 int            null comment '发卡机构数',
    account_num             int            null comment '账户数',
    creditcard_total_credit decimal(12, 2) null comment '授信总额',
    creditcard_max_credit   decimal(12, 2) null comment '单家行最高授信额',
    creditcard_min_credit   decimal(12, 2) null comment '单家行最低授信额',
    creditcard_used_amount  decimal(12, 2) null comment '已用额度',
    avg_6_mm_used_amount    decimal(12, 2) null comment '最近6个月平均使用额度',
    create_time             datetime       not null comment '入库时间',
    primary key (id, create_time)
)
    comment 'C_09-贷记卡账户汇总信息' engine = InnoDB;

create index idx_etl_report
    on pcr_credit_card_summary (etl_id, report_id);

